import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-3710 Disposition of funds.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-3710.md","filePath":"vacode/3.2-3710.md"}'),r={name:"vacode/3.2-3710.md"},n=a('<h1 id="§-3-2-3710-disposition-of-funds" tabindex="-1">§ 3.2-3710 Disposition of funds. <a class="header-anchor" href="#§-3-2-3710-disposition-of-funds" aria-label="Permalink to &quot;§ 3.2-3710 Disposition of funds.&quot;">​</a></h1><p>All fees, penalties, funds (including those transferred as specified in subsection D of § <a href="http://law.lis.virginia.gov/vacode/3.2-3709/" target="_blank" rel="noreferrer">3.2-3709</a> and except as provided in subsection C of § <a href="http://law.lis.virginia.gov/vacode/3.2-3709/" target="_blank" rel="noreferrer">3.2-3709</a>), and assessments under this chapter that the Commissioner receives shall be paid into the Feed, Lime, Fertilizer, and Animal Remedies Fund, established in § <a href="http://law.lis.virginia.gov/vacode/3.2-3617/" target="_blank" rel="noreferrer">3.2-3617</a>, to be used in carrying out the purpose and provisions of this chapter, to include inspection, sampling and other expenses; except that the Commissioner shall deposit, to the credit of the Virginia Agricultural Foundation Fund, five cents ($0.05) per ton of liming material sold per reporting year of the inspection fee.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0649" target="_blank" rel="noreferrer">649</a>, § 3.1-126.12:3; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),o=[n];function s(d,l,c,p,f,h){return i(),t("div",null,o)}const g=e(r,[["render",s]]);export{u as __pageData,g as default};
